import * as React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Richi from "./Richi";
import Login from "./Login";

function App() {
  return (
    <BrowserRouter>        
      <Routes>
        <Route path="/" element={<Login />}>          
          <Route path="/Richi" element={<Richi />} />        
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
